('15f1bbc2-3d79-41db-a345-948a91d12bc4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '557714121fbd6', 'Faire du vélo à Dresden', 'D`avoir un vélo est très pratique et facilite la vie quotidienne des réfugiés. Nous supportons des réfugiés qui vivent à Dresde et qu`ont besoin des vélos. Pour la deuxième fois nous avons adressé aux habitants à Dresden de nous donner des vélos qu`ils n`ont plus besoin. Car la plupart des vélos donnés va être vieux nous devons les réparer avec VOUS avant l`usage.\r\n\r\nOn se rencontre le 20 juin 2015, de 12.00 à 18.00 heures, à l`école Laborschule, Espenstrasse 3, 01169 Dresden (Prenez-vous les trams numéros 2 et 7, sortez à la station Kirschenstraße).\r\n\r\nL`action est gratuit. Nous pouvons vous s`aider d`apprendre à rouler à vélo. Des enfants sont bienvenus et sur le terrain il y a des jouets. Aussi nous vous offrons quelque chose à manger et nous nous réjouissons d`aliments apportés.', NULL, NULL, NULL, NULL, NULL, 'fr', NULL, NULL, NULL, NULL, NULL, '', '2015-06-13 20:41:59', '2015-06-13 20:48:15', 1, NULL, NULL, NULL, NULL),
