('2483662f-94ce-4bac-a0dd-ae5a0eb1c665', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '557708389ed53', '', 'Welcoming Alliance Freital\r\nThe Willkommensbündnis Freital is a coalition of committed citizens from Freital and surroundings who take a stand for a welcoming culture towards refugees and for the support of fled people in the region. We operate non-partisan and non-denominational. We want to be active where the obligation of the municipality, namely the housing and care of the fugitives ends. We see ourselves as a supplement to the professional helpers in social work with refugees. We want to make clear at this point that the professional refugee social work is absolutely necessary, and in fact must be further improved and expanded! Our support is an addition and can by no means replace the professionals. We organize encounter afternoons, with the help of volunteer teachers we offer German language courses. We organize board game afternoons at the asylum, hikes and sports activities in the gym of the Weißeritzgymnasium. We see our tasks in the following areas: Public relations, offering sportive and cultural activities, encounter afternoons, German language courses and sponsorships. For this purpose we created appropriate working groups.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 21:22:48', '2015-11-29 21:37:37', 1, NULL, NULL, NULL, NULL),
