('261c1ac3-f406-4134-a691-466ff421963b', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '55efe9bb3d98f', '', 'BONJOUR TOUT LE MONDE!\r\nNous sommes un groupe de musique de Dresde et recherchons des\r\npersonnes intéressées à faire un peu de musique avec nous.\r\nNous souhaitons démarrer un projet de plusieurs mois, nous retrouver\r\nchaque semaine, jouer des morceaux de vos différents pays et, à la fin,\r\ndonner un grand concert!\r\nCela t''intéresse? Tu joues d''un instrument? Ou bien tu sais chanter?\r\nAlors donne-nous ton nom et tes contacts et dis-nous quelles sont tes\r\ntalents musicaux à l''adresse suivante:\r\nblazmuzik@icloud.com facebook.com/bandacomunale', NULL, NULL, NULL, NULL, NULL, 'fr', NULL, NULL, NULL, NULL, NULL, '', '2015-09-10 11:25:38', '2015-09-10 11:25:48', 1, NULL, NULL, NULL, NULL),
