('27e6b751-4dc9-411d-ba26-20bbb1b573fc', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'We don''t have regular opening hours in winter. Please have a look on our Facebook Page!', 0, '56598e7b5b27c', 'Golgi Park Hellerau', 'Worldwide there are more than 51 million people on the run trying to escape war and violence.\r\nDue to this humanitarian catastrophy HELLERAU- European Center for the Arts Dresden took charge of a small group of refugees.\r\n\r\nTogether with them and refugees from other accommodations, the voluntary input of neighbors and cooperation with several NGOs an intercultural garden is created on the underused area behind the Festspielhaus: the Golgi Park.\r\nWith Golgi Park we build a place of intercultural encounter and ecological exchange, closely bonded to the artistic program and social commitment for refugees of the European Center for the Arts Dresden.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-28 12:22:59', '2015-12-03 21:55:45', 1, NULL, NULL, NULL, NULL);
