('282ad5f0-b051-4906-ba17-0fc879233337', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '557714121fbd6', 'قيادة الد راجه في درسدن', 'شئ جيد الحصول على د راجه، لذلك يحتاج المهجرين الذين وصلو الى درسدن، لهذه الد راجات\r\n\r\nللمره الثانيه ندعو الجميع للتبرع بلد راجات القد يمه و التي لا حاجة بها,حيث نقوم نحن بإصلاحها  و استخدامها، لذلك نحن بحاجة الوقت و المساعده، في اليوم 20. 06 .2015 \r\nمن الساعه 12-إلى 18   في  Laborschule Dresden in Gorbitz.\r\nهذا العمل غير مدفوع، بإمكاننا أيضا تعليم قيادة الد راجه، ونرحب أيضا بلأطفال و لهم مكان للعب،\r\nيوجد بعض الطعام، وبإمكانكم احضار الطعام ايضا،\r\n\r\nالموعد: 20. Juni, 12:00 - 18:00 Uhr\r\nالمكان:Laborschule, Espenstrasse 3, 01169 Dresden\r\n(Straßenbahn Linie 2 und 7 Haltestelle Kirschenstraße', NULL, NULL, NULL, NULL, NULL, 'ar', NULL, NULL, NULL, NULL, NULL, '', '2015-06-13 20:54:28', '2015-06-13 20:54:57', 1, NULL, NULL, NULL, NULL),
