('2fd615a3-b128-4c38-8881-f94f32e4e11d', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '557714121fbd6', 'С велосипедом по Дрездену', 'Ты ищеш велосипед, но не знаеш где взять?\r\nМы получим от жителей Дрездена велосипеды, которыйе им больше не нужны. Идёт реч о старых велосипедах которые мы можем отремонтировать вместе, прежди чем их изпользовать. Это вс ё мы можем сделать 20 июня, с 12 часов до 18 часов. На територии\r\n« Laborschule» в Dresden Gorbitz.\r\n\r\nЭта акция безплатная. Мы можем тоже научить людей кататса на велосипеде. Мы очень рады детям, на територие находитса дегская плащадка. Также будет вазможность покушатьи мы будем рады если вы что то принесёте с с бой. \r\n\r\nКогда: 20 иююня, от 12 -18 часов\r\nГде: Laborschule, Espenstrasse 3, 01169 Dresden (астановка Kirschenstrasse, с трамвайом 2 или 7)', NULL, NULL, NULL, NULL, NULL, 'ru', NULL, NULL, NULL, NULL, NULL, '', '2015-06-13 20:52:31', '2015-06-13 20:52:53', 1, NULL, NULL, NULL, NULL),
