('35cbe8c4-b665-4a31-bd0e-f945f7d9a009', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Mon: 2-3 p.m. Wed: 2.30-4 p.m.', 0, '565b8005f0003', 'German Lessons for Refugees Dresden', 'German lessons at different places in Dresden:\r\n\r\nLibrary Neustadt\r\nMon: 2-3 p.m.\r\nWed: 2:30-4:00 p.m.\r\n\r\nJugendstiftung, Yenidze \r\nMon, Wed, Fri: 3-5 p.m.\r\n\r\nNeonworx \r\nTues: 3-5 p.m.\r\nThu: 4-6 p.m.\r\nFri: 4-6 p.m.\r\nand \r\nMon: 10-12 a.m.\r\nTues: 9-11 a.m.\r\nFri: 4-6 p.m.\r\nand\r\nMon: 5:00 p.m.-7:00 p.m., \r\nWed/ Fri: 9:00-11:00 a.m.\r\n\r\nSpike e.V.\r\nMon-Thu: 3-5 p.m.\r\n\r\nAre you interested in joining our team?  Then send an email to lehrer@glfr.de.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 23:45:59', '2015-11-30 11:59:13', 1, NULL, NULL, NULL, NULL),
('35d82640-646c-43a8-a445-151563588ea1', NULL, NULL, NULL, '21484033-ae7d-4dbe-9a75-f073f7216a3e', '13.749866', '51.062726', 'Bautzner Straße 6', 'dis1', '01099', 'Dresden', 0, 'Immer', 3, '558312678d7b5', 'Edward-Snowden-Platz', 'Diesen Sonntag wird Edward Snowden 32 Jahre alt. Der amerikanische Whistleblower, der mit seinen Enthüllungen über das Ausmaß der weltweiten Überwachung durch US-Geheimdienste Geschichte schrieb und derzeit im russischen Exil lebt, erfährt pünktlich zu seinem Geburtstag in Dresden eine besondere Ehrung. Unweit des Albertplatzes wird ein kleiner Platz auf dem Gelände Bautzner Straße 6 auf seinen Namen getauft. Mit dieser deutschlandweit ersten derartigen Würdigung möchte Markwart Faussner, Miteigentümer des Grundstückes, ein Zeichen setzen und den mutigen Einsatz von Whistleblowern weltweit und damit auch in Deutschland würdigen.', '', 'http://edward-snowden-platz.de/', '', '', 3, 'de', '', '', '', 'logo', 0, '', '2015-06-18 20:48:07', '2015-06-18 20:48:07', 1, NULL, NULL, NULL, NULL),
