('3a3b66d0-aab5-483d-ac84-355f249f0805', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'punctually at 6.00 pm - we leave this place at 6.05!', 1, '5607f60af38cc', 'Intercultural Jogging Meeting >>SKIP<<', 'Welcome! In order to do sports together, forget our daily routines for a  while and simply enjoy the wonderful landscape of Dresden, we meet near  the Elbe (ferry dock Neustadt) each tuesday at 6 p.m. The concept of this  event aims at exchanging stories and getting to know other cultures,  whereas the actual running performance is less important. We usually run  for 1–2 hours (5–20 km), which depends on the individual stamina. Every  step is your goal – take part!', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, 'German, English, Italian', '2015-09-28 23:47:12', '2015-10-07 07:54:46', 1, NULL, NULL, NULL, NULL),
