('480d9932-6ebf-48a1-bbcc-c9c280000ae1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '557714121fbd6', 'ምዝዋር ብሽክለታ ኣብ ድረስደን - ብሽክለታታት ንስደተኛታት', 'ኣብ ከተማ ድረስደን ብሽክለታ ምህላው ኣዝዩ ክውንነታዊ እዩ።  ኣብ ቀረባ እዋን ዝመጹ ስደተኛታት ብርግጽ ብሽክለታታት ክጥቀሙ ይኽእሉ እዮም። ሰባት ዛጊት ዘይጥቀሙለን ብሽክለታታቶም ከወፉዩልና ንሓቶም ኣለና። እዘን ዝተወፈያ ብሽክለታታት መብዛሕትኡ ግዜ ኣረግቶትን ዝተሰብራን ስለዝኾና ቕድሚ ኣብ ኣገልግሎት ምውዓለን ከነተዓራርየን ኣለና። ስለዚ ግዜን ሓገዝን የድልየና እዩ። ነዚ ምኽንያት ንሰነ ዕለት 20 (ቀዳም) ካብ ሰዓት 12:00 ቀትሪ ክሳብ ሰዓት 6:00 ድ.ቀ. ኣብ Laborschule (ቤት-ትምህርቲ ላቦራቶሪ) ድረስደን ኣብ (Gorbitz)ጎርቢትስ ክንራኸብ ኢና።\r\n\r\nኣብኡ ምስታፍ ነጻ እዩ። ብሽክለታ ኣዘዋውራ ከነላምድ ኢና። ቆሎዑ ክመጹ ውን ነተባብዕ: ኣብ ቀጽሪ እቲ ቤት-ትምህርት መጻወቲ ቆልዑ ኣሎ። ንኹሉ ዝኽውን መግቢ ክንቅርብ ኢና: ብተወሳኺ መግቢ ተማሊኡ ዝመጽእ እንተድኣ ሃልዩ ኸኣ ጽቡቕ።\r\n\r\nመዓስ: 20 ሰነ ሰዓት 12:00 ቀ. – 6:00 ድ.ቀ.\r\nኣበይ: Laborschule (ቤት-ትምህርቲ ላቦራቶሪ):Espenstrasse 3 ( አስፐንሽትራሰ 3); 01169 ድረስደን (መስመር ባቡር ከተማ ቁጽሪ 2 ከምኡ ውን ቁጽሪ 7) ("Laborschule") ዝብል ምልክት ኣስተብህል)', NULL, NULL, NULL, NULL, NULL, 'ti', NULL, NULL, NULL, NULL, NULL, '', '2015-06-13 20:49:49', '2015-06-13 20:50:19', 1, NULL, NULL, NULL, NULL),
