('833e1fae-df7c-4483-86ff-16811f401a89', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '5631df301001a', 'Bautzen stays colourful', '"Bautzen stays colorful - Budysin wostanje Pisany" (German: ''Bautzen bleibt bunt'') means:\r\n\r\n+to take a stand for a welcoming culture for asylum seekers and foreigners in Bautzen \r\n+ to show one''s colours for a peaceful coexistence of citizens and asylum seekers\r\n+ to side against racist, inhuman expressions and prejudices\r\nThe alliance "Bautzen is colorful - Budysin wostanje Pisany" stands for cosmopolitanism, humanity and tolerance! It is non-partisan, ecumenical, and non-commercial.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 14:39:28', '2015-11-29 14:49:19', 1, NULL, NULL, NULL, NULL),
