('860dc5ae-06a8-498a-9903-787110f9b6e5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '55884c70da562', '', 'The network "Prohlis is colorful" (German: ''Prohlis ist bunt''), is looking for citizens who would like to volunteer for refugees. We are currently seeking people who are willing to assist refugees. These "godparents" are to support the refugees who live here decentralized in flats in Prohlis in everyday things like different leisure activies or also facilitate contacts with neighbours. In so doing, you work together with social workers. However they are responsible for too many refugees which is why volunteers are urgently needed and very welcome! If you are interested, please sign up in the neighborhood management.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 21:39:23', '2015-11-29 21:49:38', 1, NULL, NULL, NULL, NULL),
