('8af82b75-93d4-4216-ac0e-a25078180de5', NULL, '184a45c2-db23-43ed-a76c-11a1e1940aa2', NULL, NULL, '13.798390', '51.003675', 'Prohliser Allee 33', 'dis1', '01239', 'Dresden', 0, '', 0, '55884c70da562', 'Paten für Geflüchtete GESUCHT', 'Das Netzwerk „Prohlis ist bunt“, sucht Bürgerinnen und Bürger die sich ehrenamtlich für Flüchtlinge engagieren möchten. \r\nAktuell suchen wir Personen, die bereit sind, Flüchtlinge zu unterstützen. Solche „Paten“ sollen die Flüchtlinge, die hier in Prohlis dezentral in Wohnungen leben, bei alltäglichen Dingen unterstützen, etwas unternehmen oder auch Kontakte zu Nachbarn vermitteln. Hierbei arbeiten Sie mit Sozialarbeiterinnen und Sozialarbeitern zusammen, die aber für zu viele Flüchtlinge zuständig sind. Deshalb sind Engagierte dringend gebraucht und erwünscht!\r\nWenn Sie Interesse haben, melden Sie sich im Quartiersmanagement', 'info@qm-prohlis.de', '', '', '0351 27 272 16', 5, 'de', 'Quartiersmanagement Prohlis, Fr. Gottmann', '', '', 'logo', 1, '', '2015-06-22 19:57:04', '2015-06-23 18:47:25', 1, NULL, NULL, NULL, NULL),
