('8e137782-b720-463a-8b4a-34dc76d16f16', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '562b6ee66cce5', 'Kästner College e.V.', 'Kästner College e.V. (German: Kästner Kolleg e.V.) is a language school that provides lecture rooms for free for the DAMF language courses. The Kästner college offers courses to be trained as language teacher for GFL courses and also a is a provider for integration courses. Special integration courses for "asylum seekers with perspective to stay" are offered from now on. The first course is scheduled for end of January 2016. Course hours: Monday - Friday, 09:30 am - 2 pm\r\nFor interested donors, there is the possibility to give direct financial support for intensive German courses for refugees. ', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 15:46:17', '2015-11-29 16:08:44', 1, NULL, NULL, NULL, NULL),
