('b7a9c3e0-69d1-45be-9ec2-f50c342da4c4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '560d283a5540b', '', 'Once a month (1st Sunday, 19 o''clock) there is contact improv dancing jam. It is open to all who (want to) connect touch, dance, movement and being human. Works also with language barriers\r\n\r\nThe jam is a place of possibilities, a social experiment lab for research dance together, in the group or by yourself. Sometimes with musicians, sometimes with silence, mostly with music and warm up in the beginning.\r\n', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, 'all (current speakers use German, English, sometimes French, Czech, Italian, Spanish)', '2015-11-02 12:11:12', '2015-11-02 12:12:03', 1, NULL, NULL, NULL, NULL),
