('b8b422e6-78f4-4316-8080-5033f34244fb', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '55efe9bb3d98f', '', 'Привет всем!\r\nМы, музыкальная группа из Дрездена, ищем заинтересованных людей,\r\nкоторые хотят с нами играть. Мы хотим создать музыкальный проект,\r\nкоторый будет длиться несколько месяцев. Каждую неделю все вместе мы\r\nбудем встречаться для совместных репетиций и играть музыку из твоей\r\nстраны. В конце нашего проекта намечается большой концерт!\r\nТы заинтересован?\r\nТы поёшь или владеешь каким-нибудь музыкальным инструментом?\r\nЕсли да, оставь пожалуйста следующую информацию: имя, контактные\r\nданные, национальность и на каком инструменте ты играешь. Пиши нам по\r\nадресам:\r\nblazmuzik@icloud.com facebook.com/bandacomunale', NULL, NULL, NULL, NULL, NULL, 'ru', NULL, NULL, NULL, NULL, NULL, '', '2015-09-10 11:26:27', '2015-09-10 11:26:40', 1, NULL, NULL, NULL, NULL),
('b8d76138-162a-4687-8334-4d2ec66c702d', NULL, '184a45c2-db23-43ed-a76c-11a1e1940aa2', NULL, NULL, '13.792398', '51.006402', 'Georg-Palitzsch-Str. 2', 'dis1', '01239', 'Dresden', 0, 'Sa: 10:00-11:30 Uhr', 0, '566aaae578fe5', 'Deutschtreff Samstagskurs', 'Zwei Mal in der Woche findet ein von Prohlis ist bunt veranstalteter niedrigschwelliger Deutschtreff als erster Kontakt zur deutschen Sprache statt. Der Kurs ist offen für alle, man kann jederzeit einsteigen.\r\nDonnerstags 10_00-11:30 Uhr im Bürgersaal des Ortsamtes Prohlis, Samstags 10:00-11:30 in der Evangelischen Kirchgemeinde Prohlis.', '', '', '', '', 3, 'de', 'Frau Dr. Gaitzsch, Frau Erfurt', '', '', 'logo', 0, '', '2015-12-11 11:52:21', '2015-12-11 12:36:02', 1, NULL, NULL, NULL, NULL),
