('c5db9bdc-9024-4146-b009-cf54f5337fe5', NULL, '2b45d4b2-ff0e-4f2c-95d1-731ed0e1ebdf', NULL, NULL, '13.753104', '51.113124', 'Karl-Liebknecht-Str. 56', 'dis1', '01109', 'Dresden', 0, 'Wöchentlich Mittwochs 17-18:30', 0, '557c802a09424', 'Theaterkurs für Jugendliche', 'Der Kursleiter Abrhale Daniel stammt aus Eritrea und spielt seit frühster Kindheit Theater.\r\nIn den wöchentlichen Treffen werden je nach Vorerfahrung und Wünschen der Teilnehmer Improvisation, kurze Szenen oder ein Stück erarbeitet. Der Kurs richtet sich vornehmlich an Jugendliche im Alter von 16-25 Jahren mit keiner oder wenig Vorerfahrung im Theaterspielen. \r\nAnmeldung über unsere Website, Teilnahme auf Spendenbasis. Wöchentlich Mittwochs 17-18:30 im Festspielhaus Hellerau.', '', '', '', '', 3, 'de', 'KAMA Dresden e.V.', '', '', 'logo', 0, 'Deutsch, Tigrinisch', '2015-06-13 21:10:34', '2015-06-13 21:17:17', 1, NULL, NULL, NULL, NULL),
