('c940ce90-8bf5-4b15-a86c-69b30890ab3b', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '568cc2d0c7a64', '', '\r\nوصف:\r\nنادي صندوق بات الملون " Bat‘s Color Box" يقدم عروضاً للأطفال واليافعين, والأهالي الشباب مع أطفالهم.\r\nعروضنا مقدمة لكل الذين لديهم رغبة في التسلية مع الأصدقاء, االمشاركة ببعض الألعاب الجماعية, تجربة وتعلم بعض أنواع الرياضة , الأشغال اليدوية, المشاركة في ورشات عمل الخشب والفخار, ركوب الدراجة الهوائية, تصليح الدراجات الهوائية.\r\nعلاوة على ذلك يقدم النادي عروضات ونشطات حول مواضيع متخصصة. \r\nيمكن للكل المشاركة بالمجموعة المناسبة, كل النشاطات والعروضات التي يقدمها النادي مجانية للجميع:\r\n- مجموعات للأطفال بدءا من عمر 6 سنوات: أشغال يدوية, ألعاب جماعية (مونوبولي, شطرنج...), بلياردو, \r\n- مجموعات بمواضيع محتلفة : معرض, رياضات قتالية, رقص للأطفال.\r\n- نادي الحاسوب " الكومبيوتر": تصفح و بحث على الانترنت, ألعاب جماعية على الكومبيوتر.\r\nويوجد لقاءات ونشاطات جماعية لمجموعات معينة أخرى مثل:\r\n-  مجموعات الأهالي مع أطفالهم: مثل مجموعة الأهالي ذوي الأطفال في عمر الرضاعة, أو مجموعة الأهل في عمر الزحف (الحبو).\r\n- نشاطات و عروضات ذات مواضيع مميزة لأيام العطل.\r\n', NULL, NULL, NULL, NULL, NULL, 'ar', NULL, NULL, NULL, NULL, NULL, '', '2016-02-12 12:35:03', '2016-02-12 12:40:30', NULL, '', NULL, NULL, NULL),
('c9a9b4d8-78d7-460a-b864-c8e60f70f612', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '557714121fbd6', 'دوچرخه سواری در درسدن – دوچرخه برای پناهنده ها', 'باشه، و حتی پناهنده هایی که تازه وارد شهر می شن، می تونن به راحتی ازش استفاده کنن.\r\nما از کسانیکه دوچرخه اضافه یا بدون استفاده دارن، خواهش می‌کنیم که اونا رو به ما بدن. اما بیشتر این دوچرخه ها قدیمی یا خراب هستن و ما برای تعمیر و قابل استفاده کردنشون نیاز به زمان و کمک داریم.\r\nبه همین دلیل، روز بیست یونی (یکشنبه) بین ساعت 12 ظهر تا 6 بعدازظهر، همدیگه رو توی لابورشوله (Laborschule) درسدن واقع در گوربیتس (Gorbitz) می بینیم.\r\n\r\nاین برنامه به صورت رایگان برگزار می شه و ما توش به کسانیکه دوست دارن، دوچرخه سواری یاد می دیم. از اومدن بچه‌ها هم خوشحال می شیم و براشون تو محوطه مدرسه وسیله بازی وجود داره.\r\nخوراکی برای پذیرایی از همه هست، اما خوشحال می شیم اگه کسی بخواد همراه خودش خوراکی دیگه ای هم بیاره.\r\n\r\nزمان: 20 یونی، 12 ظهر تا 6 بعدازظهر\r\nمکان: لابورشوله (Laborschule)، اسپن اشتراسه (Espenstraße) شماره 3 , 01169 درسدن (ترام 2 یا 7، ایستگاه کیرشن اشتراسه (Kirschenstraße) – حواستون به تابلوی “Laborschule“ باشه!)', NULL, NULL, NULL, NULL, NULL, 'fa', NULL, NULL, NULL, NULL, NULL, '', '2015-06-13 20:53:24', '2015-06-13 20:54:18', 1, NULL, NULL, NULL, NULL),
