('cc4d3102-82da-41df-ab0d-fcadf5ec944f', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Wednesday 5 pm - 6:30 pm', 0, '557c802a09424', '', 'KAMA Dresden e.V. - Theater course for youths\r\nThe course instructor Abrhale Daniel comes from Eritrea and is acting already from his earliest years on. In the weekly meetings ad-libbing, short scenes or a stage play are developed, depending on previous experiences and wishes of the participants. The course is aimed primarily to young people aged between 16 and 25 years with no or little previous experience in acting. Registration is possible via our website, participation fee is based on donation. Weekly on Wednesdays 5 pm - 6:30 pm at the Festspielhaus Hellerau.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, 'German, Tigrinya', '2015-11-29 20:34:28', '2015-11-29 20:44:48', 1, NULL, NULL, NULL, NULL),
