('d46cd282-0632-40b3-b97f-2354b1a03629', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Wednesday and Friday: 10 am - 12 pm', 0, '5631e6e687a06', 'Dresden für Alle e.V. - Dresden for all e.V.', 'Dresden for all! A network for all those who see themselves as people of Dresden, regardless of their nation, religion, color or gender. The network ''Dresden für Alle'' connects people and organizations who are comitted to the fundamental consensus for a democratic, humane and including urban society. The network is in principle open to all actors who commit themselves to the fundamental consensus of the network. The network therefore represents a broad spectrum of a dedicated, democratic urban community. The operation of the network is self-determined, democratically and participatory. It is capable to act and mobilizable and has an efficient management. The network should be operated and utilized in a  resources-sparing way.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-28 16:16:01', '2015-11-28 16:24:06', 1, NULL, NULL, NULL, NULL),
