('d63b6df3-0b12-47cc-8df6-b821dba52714', NULL, '0d8f59fa-e79e-4feb-846a-ce3d117d4176', NULL, NULL, '13.672376', '51.048639', 'Leutewitzer Ring 75', 'dis1', '01169', 'Dresden', 0, 'Dienstag 18 :00 - 20:30 Uhr', 0, '566aec1526a74', 'GO IN Begegnungstreff', 'Die Idee für ein Begegnungscafé mit Dresdnern und Flüchtlingen entstand beim Runden Tisch in der Philippuskirche Gorbitz. Später wurde das Projekt in GO IN umbenannt.\r\n\r\nNachdem erste Berührungsängste überwunden waren, wurden die deutschen Helfer mit vielen Alltagsproblemen der Flüchtlinge konfrontiert. Die Anfragen reichen von der Unterstützung zur Suche eines ersten Deutschkurses über das Beschaffen von gebrauchten Einrichtungsgegenständen, Kleidungsstücken und Fahrrädern bis hin zu Transporthilfen bei\r\nUmzügen und kleinen handwerklichen Arbeiten in den Wohnungen der Flüchtlinge.', '', '', '', '', 3, 'de', '', '', '', 'logo', 0, '', '2015-12-11 16:30:29', '2015-12-15 16:53:16', 1, NULL, NULL, NULL, NULL),
