('d9cf4264-6a21-4dfb-9f70-c8cc1bd221aa', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '55c464fa1b908', '', 'This is an open forum to promote kindness and understanding towards asylum seekers. "Haselbachtal" is a municipality near the cities Dresden and Bautzen in Germany with around 4000 inhabitants. By March 1, 35 refugees are going to move there. The "Haselbachtalerians" do have a lot of concerns and worries about the newcomers - and a lot of people started to support a Facebook group called "Haselbachtal wehrt sich" (Engl. "Haselbachtal defends itself") claiming that they are confronted with a flood of refugees and ignorant despotism. (Btw: Only few foreigners live in this region compared to others in Germany.) The members of our group, however, do not believe that we are in a state of some kind of war and want to support the idea of a welcoming society showing solidarity - with their hearts and minds. This is what the group name stands for: With our hearts (German: Herzen) and minds (German: Verstand) we want to engage in a fair debate providing information on migration and the asylum system as well as by sharing experiences in order to reduce prejudice and fear. Everybody is welcome here! In this group, and in the society that we want to create. We start NOW - in my hometown.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 20:17:28', '2015-11-29 20:18:14', 1, NULL, NULL, NULL, NULL),
