('e95656ea-b2dc-4052-8689-3796d79e4844', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '55efe9bb3d98f', '', 'سلم به همگی!\r\nما گروه موسیقی در درسدن هستیم و در جستجوی کسانی که دوست دارند با ما موسیقی\r\nتولید کنند. این یک پروژه موسیقی است که در آن ما و شما همدیگر را به مدت چند ماه هر\r\nهفته ملقات می کنیم، آهنگ هایی از کشور شما تمرین می کنیم و در پایان با هم یک\r\nکنسرت بزرگ برگزار می کنیم.\r\nعلقمند هستید؟ سازی می نوازید؟ می توانید خوانندگی کنید؟\r\nلطفا نام، شماره تماس، کشور و اطلعاتی راجع به این که چه سازی می نوازید یا توانایی\r\nخوانندگی تان را به این آدرس ایمیل کنید:\r\n!با تشکر\r\nblazmuzik@icloud.com facebook.com/bandacomunale', NULL, NULL, NULL, NULL, NULL, 'fa', NULL, NULL, NULL, NULL, NULL, '', '2015-09-10 11:29:56', '2015-09-10 11:30:02', 1, NULL, NULL, NULL, NULL),
('e9824b3c-8da5-4ba2-9f24-07ea5c33b6e1', NULL, '9f0d6ac1-fd52-4068-9b82-25a75f3492c8', NULL, NULL, '14.0198513', '51.1449933', '', 'dis1', '01900', 'Großröhrsdorf', 0, '', 0, '563a9211697c9', 'Bündnis Bunte Westlausitz', '', '', '', '', '', 3, 'de', '', '', '', 'logo', 0, '', '2015-11-05 00:17:37', '2015-11-05 00:17:37', 1, NULL, NULL, NULL, NULL),
('ea252564-083c-472b-abd1-3de6c0a9bd38', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '556e1d313acbd', 'DAMF Deutschkurse für Asylsuchende ዳምፍ ዶች ኮርስ ፊዩር ኣዙል ዙኸንደ', '', NULL, NULL, NULL, NULL, NULL, 'ti', '', NULL, NULL, NULL, NULL, '', '2015-06-02 23:17:21', '2015-06-02 23:17:21', 1, NULL, NULL, NULL, NULL),
('ea3c2ee6-7d89-406a-b4ad-57216840a5cf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '55fd7f2274bbb', 'Хоккей для  интеграции и  толерантности', 'Хотите заняться спортом? Приходите к нам на хоккей!\r\nХоккей означает выдержку, скорость, силу, командный дух и много радости! Мы ищем мальчиков и девочек, которые готовы играть в наших командах!\r\nКогда?  С сентября 2015! \r\nПожалуйста, принесите с собой: Спортивную обувь и одежду (если есть)\r\nМы будем рады вас видеть!\r\n\r\nТрамвай 12, Остановка Birkenhainerstraße\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, 'ru', NULL, NULL, NULL, NULL, NULL, '', '2015-10-18 22:28:12', '2015-10-18 22:40:00', 1, NULL, NULL, NULL, NULL),
('ea44d284-29a9-4470-b083-5741edc29c24', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '5627fd7ea1df2', 'Administrative District Office Pirna', 'Administrative District Office Pirna - Section asylum services / Accomodation \r\n(German: Landratsamt Pirna - Referat Asylleistungen / Unterbringung) \r\n\r\nThe section asylum services is responsible for the implementation of the German Social Welfare Law for Asylum Seekers (Asylbewerberleistungsgesetz). This law regulates which foreigners staying in Germany are actually eligible for benefits and which benefits they are entitled for. With the provided benefits, among others the necessary needs for food, clothing and health care have to be ensured. Beyond that, benefits can also be provided in the cases of sickness, pregnancy and birth. The administration district Pirna as the lower accommodation authority is responsible for the reception, accommodation and distribution of asylum seekers according to the Asylum Procedure Act and in this regard, for the creation and operation of housing facilities in the form of communal accommodation or other accommodations such as apartments.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 16:31:55', '2015-11-29 17:29:17', 1, NULL, NULL, NULL, NULL),
