('ef8db4c6-c917-44d7-936e-0d9c26386e39', NULL, 'f3c6a8d5-352a-4557-9e99-8a1b9edf9a00', NULL, NULL, '13.756609', '51.064576', 'Martin-Luther-Platz 5', 'dis1', '01099', 'Dresden', 0, 'Montag 10 bis 12 Uhr Donnerstag 15 bis 17 Uhr', 0, '567424ca5be4d', 'ABC-Tische Martin-Luther-Gemeinderaum', 'Wir wollen mit unseren ABC-Tischen den Neuankömmlingen eine erste Orientierung bieten und sehen es als unsere Aufgabe, ihnen die grundlegendsten Dinge zu vermitteln, um die dringendsten Bedürfnisse mitteilen zu können und die ersten Schritte selbständig tun zu können. Die ABC-Tische finden regelmäßig an unterschiedlichen Orten statt.', 'neustadt.helfer@gmail.com', 'http://akifra.org/projekte/dresdner-gefluechtetenprojekte/abc-deutsch-lern-willkommenskultur-tische/', '', '', 3, 'de', 'Christian Steinert', 'Christian Steinert', '', 'logo', 0, '', '2015-12-18 16:22:50', '2016-01-27 21:49:48', 1, '', '', '', NULL),
('efd06667-234e-4a9f-b718-73915cbca663', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, '55e9c0674ebb8', '', 'The coordinator for asylum volunteering of the city of Dresden\r\n\r\nAt the Dresden City Council volunteers can find out how and where they can get involved. The coordinator for asylum volunteering Clemens Hirschwald answers the questions of volunteers.', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-11-29 21:16:48', '2015-11-29 21:20:07', 1, NULL, NULL, NULL, NULL),
