('f192d932-b512-4af6-bc4e-914296f8dac0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 1, '557714121fbd6', 'Cycling in Dresden - Bikes for Refugees', 'It is tremendously practical to have a bike in Dresden. Refugees, who arrived in Dresden, could surely use bikes. We are asking people to donate bikes which they do not need anymore. These donated bikes are often older or broken ones, which we need to repair, before they can be used. Therefor we need time and help. For that we meet at 20 of June (Saturday) between 12 p.m. and 6 p.m. at the Laborschule (lab school) Dresden in Gorbitz.\r\n\r\nThe event is for free. We can show people how to ride a bike. Children are welcome, play equipment at the area of the school is available. We provide food for everyone and we are glad if someone brings food in addition.\r\n\r\nWhen: 20th June, 12 p.m.- 6 p.m.\r\nWhere: Laborschule (labschool), Espenstrasse 3, 01169 Dresden (tram line 2 and 7 stop Kirschenstraße)(watch out for signs "Laborschule")', NULL, NULL, NULL, NULL, NULL, 'en', NULL, NULL, NULL, NULL, NULL, '', '2015-06-13 20:40:33', '2015-06-13 20:48:41', 1, NULL, NULL, NULL, NULL),
