('fbf11389-a61d-42f2-abf3-c2de4394cb49', NULL, 'b67478f2-cbda-491a-9cb4-ce351e42e792', NULL, NULL, '13.955444', '50.953386', 'Straße der Jugend 2, Kellerraum ', NULL, '01796', 'Pirna', 0, 'Mittwoch 14-18 Uhr ', 0, '56ce1b8eae151', 'Fahrradwerkstatt', 'Unter Anleitung können die eigenen Fahrräder repariert werden. Dank einer Fahrradspende aus Leipzig stehen aber auch ca. 30 Damen-, Herren-, Jugend- und Kinderfahrräder zur Verfügung, die gemeinsam auf Vordermann gebracht werden und für Zahlung eines geringen Materialpreises mitgenommen werden können.\r\nWer Interesse an der Mitarbeit in der Fahrradwerkstatt hat, kann sich an D. Mierau wenden Tel. 03501/711976', '', 'http://www.ag-asylsuchende.de/index.php/8-news/101-fahrradreparaturwerkstatt-in-pirna', '', '', NULL, 'de', '', '', NULL, NULL, 0, '', '2016-02-24 22:07:26', '2016-02-24 22:19:29', 1, '', '', '', NULL),
