('fdb6ca16-734c-4a1e-8657-c83fe76b1207', NULL, '4569e3ef-fdb3-4a79-823e-1c6dabdfec96', NULL, NULL, '13.742376', '51.058097', 'Neustädter Markt 9', 'dis1', '01097', 'Dresden', 0, '', 0, '5696bc1d0672d', 'International Friends Dresden', '', '', '', '', '', 3, 'de', '', '', '', 'logo', 0, '', '2016-01-13 22:05:33', '2016-01-13 22:05:33', 1, NULL, NULL, NULL, NULL),
('fddebcf8-1c93-4724-9da4-41c80f38c59f', NULL, '1c9e3098-4720-45d1-9210-7cd1a3ef75e8', NULL, NULL, '13.803443', '51.024908', 'Schilfweg 3', 'dis1', '01237', 'Dresden', 0, '', 1, '569d63e4e403d', 'Deutsch-Einstiegskurse für Asylbewerber/innen', 'Kostenfreie Deutsch-Einstiegskurse für Asylbewerberin-nen und Asylbewerber an der Volkshochschule Dresden Anmeldung ab sofort möglich! \r\n\r\nDer Sprachkurs ist für Berechtigte kostenlos. Die Fahrtkosten (Monatskarte) werden erstattet.\r\n\r\nTeilnehmen können Ausländerinnen und Ausländer, die bei der Kursanmeldung eine Aufenthaltsgestattung bzw. eine Bescheinigung über die Meldung als Asylsuchender (BüMA) besitzen und nicht aus einem sicheren Herkunftsstaat nach § 29a Asylgesetz stammen und bei denen ein rechtmäßiger und dauerhafter Aufenthalt zu erwarten ist. Das betrifft Personen aus den Herkunftsländern Eritrea, Irak, Iran und Syrien. \r\n\r\nAnmeldung in der Geschäftsstelle der VHS Dresden (Mo bis Fr von 9 bis 13 Uhr sowie Di und Do von 14 bis 18 Uhr), im Raum 203, zum Kurs anmelden. \r\n', '', '', '', '0351 25440-0 ', 3, 'de', 'Regina Molke', '', '', 'logo', 0, '', '2016-01-18 23:15:00', '2016-01-18 23:15:00', 1, NULL, NULL, NULL, NULL),
